import './categories.styles.scss';

const App = () => {
  const catagories = [
    {
      id: 1,
      title: "Hats"
    },
    {
      id: 2,
      title: "Jacket"
    },
    {
      id: 3,
      title: "sneakers"
    },
    {
      id: 4,
      title: "womans"
    },
    {
      id: 5,
      title: "mens"
    }

  ]

  return (
    <div className="catagories-container">
      {catagories.map(({ title }) => (
        <div key={id} className="catagory-container">
          <div className="background-image" />
          <div className="catagory-body-container">
            <h2>{title}</h2>
            <p>Shop Now</p>
          </div>
        </div>
      ))}
    </div>
  );
}

export default App;
